// Sidebar.js
import React from 'react';
import { Link } from 'react-router-dom';
import './Sidebar.css'; // Yeh humari CSS file hogi

const Sidebar = () => {
  return (
    <div className="sidebar">
      <Link className="menu-item" to="/dashboard"><i className="icon-dashboard"></i> My Dashboard</Link>
      <Link className="menu-item" to="/tasks"><i className="icon-tasks"></i> My Tasks</Link>
      <Link className="menu-item" to="/teams"><i className="icon-teams"></i> My Teams</Link>
      <Link className="menu-item" to="/clients"><i className="icon-clients"></i> My Clients</Link>

      {/* Grouping Help, Notifications, and Profile links */}
      <div className="bottom-links">
        <Link className="menu-item" to="/help"><i className="icon-help"></i> Help</Link>
        <Link className="menu-item" to="/notifications"><i className="icon-notifications"></i> Notifications</Link>
        <Link className="menu-item" to="/profile"><i className="icon-profile"></i> Profile</Link>
      </div>
    </div>
  );
};

export default Sidebar;
